import React from 'react';

const ResultRenderer = (props) => {
    return ( 
    <div>
        {this.props.image_url ?
        <div key='image' className='image'>
            <img src={props.image_url} alt="profile=pic" />
        </div>
        :
        null
        }
        <p>{props.username}</p>
    </div> 
    );
}

export default ResultRenderer;
